import React from "react";
import "./Home.scss";

const Home = () => {
  return (
    <>
      <div className="hero">
        <h1>
          Find inspiration for your next vacation. Read travel stories and find
          your next trip.
        </h1>
      </div>
    </>
  );
};

export default Home;
